import React from 'react'

import { ItemContainer } from './styles';

function ItemRepo() {
  return (
    <ItemContainer>
      <h3>Nicarlo</h3>
      <p>dio/nicarlo</p>
      <a href='#' className='remover'>Ve</a>
      <a href='#' className='remover'>Remove</a>
      <hr />
    </ItemContainer>
  )
}

export default ItemRepo;
